<script>
import firebase from 'firebase/app';
import 'firebase/auth'
import 'firebase/database'
export default {
  data() {
        return {
        // selected: "Please select one",
        title:"",
        link:"",
        media: "",
        description: "",
        show: '',
        display: '',
        type: "Please select one",
        show: false,
        isOpen: false,
        types:['Please select one','Announcement','Seminar','Acivities'],
        }
    },

    created() {
        firebase.auth().onAuthStateChanged(user => {
            if (user) {
                this.show = true
                this.display = user.displayName
            }
            else{
                window.location.pathname="/"
            }
        })
    },
    methods: {
        createPost() {
            const postRef = firebase.database().ref('posts/');
            if (this.title==="" || this.type==="Please select one" || this.description==="") {
                console.log('gago'),   
                alert('All fields must be filled out')
            }else{
                const videoUrl = this.link
                const videoId = videoUrl.substr(videoUrl.indexOf('=') + 1, videoUrl.length)
                postRef.push({
                title: this.title,
                type: this.type,
                videoId: videoId,
                description: this.description, 
                date: Date.now() 
            }).then(() => {
                this.submitted=true
                console.log('Posted!')
                window.location.pathname='/home_admin'
            }).catch(err => {
                console.log(err.message)
            })
            }
            
        },
        validate(){
            this.$validator.validateAll().then(result => {
        if (result) {
          console.log("No error");
          this.createPost();
        } else {
          console.log("Errored");
        }
      });

        }
    }
}
</script>

